% 迭代均值（期望Ex)的计算公式可以转化为RM问题，从而进行收敛性分析
close all; clear all;

N = 10000;
% 减小方差：将[-0.5, 0.5]改为[-0.1, 0.1]
x = 5 + 0.2*(rand(N,1) - 0.5);  % x在[4.9, 5.1]之间均匀分布，方差更小

% 初始化
omega(1) = 10;  % 起始点改为10
g_values = zeros(N-1, 1);  % 存储每一步的g(ω)值
omega_values = zeros(N-1, 1);  % 存储每一步的ω值

% 迭代过程
for i = 2:N
    % alpha = 1/(i^0.6);
    alpha = 1/i;
    % alpha = 0.1;
    % alpha = 0.01;
    
    % 存储当前值
    omega_values(i-1) = omega(i-1);
    g_values(i-1) = omega(i-1) - x(i-1);
    
    % 更新ω
    omega(i) = omega(i-1) - alpha * g_values(i-1);
end

% 创建图形
figure('Position', [100, 100, 1200, 500]); %[output:3fd376b8]

% 子图1: 迭代轨迹在g(ω) = ω - x平面上
subplot(1, 2, 1); %[output:3fd376b8]
hold on; %[output:3fd376b8]
grid on; %[output:3fd376b8]

% 绘制几条代表性的直线 g(ω) = ω - x
% 由于x是随机变量，我们绘制x的最小值、最大值和均值的直线
omega_range = linspace(5, 10.5, 100);
x_min = min(x);
x_max = max(x);
x_mean = mean(x);

plot(omega_range, omega_range - x_min, 'b-', 'LineWidth', 1, 'DisplayName', sprintf('g(ω)=ω-%.3f (x_{min})', x_min)); %[output:3fd376b8]
plot(omega_range, omega_range - x_mean, 'r-', 'LineWidth', 2, 'DisplayName', sprintf('g(ω)=ω-%.3f (x_{mean})', x_mean)); %[output:3fd376b8]
plot(omega_range, omega_range - x_max, 'g-', 'LineWidth', 1, 'DisplayName', sprintf('g(ω)=ω-%.3f (x_{max})', x_max)); %[output:3fd376b8]

% 绘制零线（g=0）
plot(omega_range, zeros(size(omega_range)), 'k:', 'LineWidth', 1, 'DisplayName', 'g(ω)=0'); %[output:3fd376b8]

% 绘制迭代过程的点
num_points_to_plot = min(100, length(omega_values));  % 绘制前100个点
for i = 1:num_points_to_plot
    % 使用颜色渐变表示迭代过程
    color_ratio = i/num_points_to_plot;
    point_color = [color_ratio, 0, 1-color_ratio];  % 从蓝色渐变到红色
    
    % 绘制当前迭代点
    plot(omega_values(i), g_values(i), 'o', 'MarkerSize', 4, ... %[output:3fd376b8]
         'MarkerFaceColor', point_color, 'MarkerEdgeColor', point_color); %[output:3fd376b8]
    
    % 只标注关键点：起始点、结束点和少数中间点
    if i == 1
        plot(omega_values(i), g_values(i), 'ro', 'MarkerSize', 10, ...
             'MarkerFaceColor', 'r', 'DisplayName', '起始点(ω=10)');
        text(omega_values(i)+0.05, g_values(i), '起点', 'FontSize', 10, 'FontWeight', 'bold');
    elseif i == num_points_to_plot
        plot(omega_values(i), g_values(i), 'go', 'MarkerSize', 8, ...
             'MarkerFaceColor', 'g', 'DisplayName', '终点(前100步)');
        text(omega_values(i)+0.05, g_values(i), '终点', 'FontSize', 10, 'FontWeight', 'bold');
    elseif i == 5 || i == 20 || i == 50
        % 标注几个关键中间点
        text(omega_values(i)+0.05, g_values(i), num2str(i), 'FontSize', 8);
    end
end

% 绘制迭代过程的连线（用虚线）
